import './App.css';
import React, { useEffect, useState } from "react";
import axios from 'axios';

function App() {
  const [userList, setUserList] = useState([])


  async function fetchData() {
    let response = await axios("https://jsonplaceholder.typicode.com/users/");
    let user = await response.data;
    setUserList(user);
    console.log(userList);
  }

  useEffect(() => {

    fetchData();
  }, [])


  return (
    <>

      {

        userList.map((user) => {
          return <div key={user.id} className="card mb-3" style={{ maxWidth: 540 }}>
            <div className="row no-gutters">
              <div className="col-md-4">
                <img src="..." className="card-img" alt="..." />
              </div>
              <div className="col-md-8">
                <div className="card-body">
                  <h2 className="card-title">{user.name}</h2>
                  <h6 className="card-text" >Username: {user.id}</h6>
                  <h6 className="card-text">Username: {user.username}</h6>
                  <h6 className="card-text">Email: {user.email} </h6>
                  <h6 className="card-text">Address: {user.address.street},{user.address.suite},{user.address.city} </h6>
                </div>
              </div>
            </div>
          </div>
        })
      }



    </>
  );
}

export default App;
